Internally each native test will be stored as one of three types: fn() -> Result<()> it "has no 'async' keywords"{ expect(true).to_be_true()?;
} fn() -> BoxedFutureSend it "has send futures"{ tokio::time::sleep(Duration::from_millis(100)).await?;
} fn() -> BoxedFuture it nonSend "has non-send futures"{ //example of a common non-send async function fantoccini::ClientBuilder::native().connect("http://example.com").await;
} By default Sweet will detect the await keyword and mark that test as containing Send Futures. The nonSend flag must be specified if your test contains a non-send future. Note: currently if the runner finds any nonSend tests it will run all tests on the main thread, even if the parallel flag is supplied.

