# use extend::ext;
# use sweet::*;
# # #[derive(Debug)]
struct Awesomeness(u32); #[ext]
pub impl Matcher<Awesomeness> { fn to_be_more_awesome_than(&self, other:Awesomeness) -> Result<()> { let outcome = self.0 > other.0; let expected = format!("to be more awesome than {:?}", other); self.assert_correct(outcome, &expected) }
} Note that here we are calling self.assert_correct() which does to things: checks the outcome is true, or false in the case of negation: expect(foo).not().to_be_more_awesome_than(bar) Formats a pretty backtraced output error if needed.

