The parent node is also concerned about the state of its children. In this example it will select the first child that has a passing edge state. #[node_system]
fn parent<Node: AiNode>(mut commands: Commands, mut query: Query<Node::ChildQuery>) { for (entity, edges) in Node::child_states(&mut query).iter() { for (index, edge) in edges.iter().enumerate() { if *edge == EdgeState::Pass { Node::set_child_node_state(&mut commands, *entity, index).unwrap(); continue; } } }
} Note the Node::edges function that converts a tuple query of (Edge1,Edge2,Edge3) into a Vec<EdgeState>.

